import React from "react";
import "./skill.css";
import UIDesign from "../../assets/images/icon2.png";
import WebDesign from "../../assets/images/icon3.png";
import AppDesign from "../../assets/images/icon4.png";

const Skills = () => {
  return (
    <section id="skills">
      <span className="skillTitle"> What I do </span>
      <span className="skillDesc"> Write your skills here. What you do? </span>

      <div className="skillBars">
        <div className="skillBar"></div>
      </div>
    </section>
  );
};
export default Skills;
